const HomeView = '/';
const RecipeView = '/recipes';
const DrinkView = '/drinks';
const FoodView = '/food';
const SigninView = '/signin';
const SettingsView = '/user/settings';

// eslint-disable-next-line
export default {
    HomeView,
    RecipeView,
    DrinkView,
    FoodView,
    SigninView,
    SettingsView
}
